import "./NewExpense.css";

function NewExpense(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.title[0].title}
        amount={props.amount[0].amount}
        date={props.date[0].date}
      />
      
    </div>
  );
}

export default NewExpense;
